demo.repl.help:
คำสั่งที่ใช้ได้:
  @show              ─ แสดงสรุป adaptive card ล่าสุด
  @json              ─ แสดงค่า JSON ดิบที่ได้รับจากโฟลว์
  @back              ─ ย้อนกลับไปยังการ์ด/อินพุตที่ถูกบล็อกก่อนหน้า
  @input <k>=<v>     ─ ตั้งค่าหรือเขียนทับช่องอินพุต
  @click <action_id> ─ ส่งการ์ดด้วยแอ็กชันที่ระบุ
  @help              ─ พิมพ์ข้อความช่วยเหลือนี้
  @quit              ─ ออกจาก REPL
